import BillItemName from '../../atoms/main/BillItemName';
import BillItemPrice from '../../atoms/main/BillItemPrice';
import './billItemDetail.scss';

export class BillItemDetail extends Component {
    render() {
        const { item } = this.props;
        const itemWeight = weight>=1 ? weight+"kg" : (weight*1000)+"g";
        return (
            <div className='billItemDetail'>
                <div className="billItemName">{item.name}</div>
                <div className="billItemWeight">{itemWeight}</div>
                <div className="billItemPrice">
                    <p>₹{item.price}</p>
                    <s>₹{item.MRP}</s>
                </div>
            </div>
        )
    }
}

export default BillItemDetail
